import React from 'react';
import '../styles/Global.css'; // Importe o CSS que contém .apresentacao_imagem e floatAnimation

const AnimatedUnicornBackground = () => {
  return (
    <div style={{
      position: 'absolute',
      top: 0,
      left: 0,
      width: '100%',
      height: '100%',
      overflow: 'hidden',
      zIndex: -1, // Garante que fique no fundo
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
    }}>
      <img 
        src="/assets/ia.png" 
        alt="Unicórnio Animado" 
        className="apresentacao_imagem"
        style={{
          width: '50%',
          maxWidth: '450px',
          height: 'auto',
          opacity: 0.15, // Ajuste a opacidade para o fundo
        }}
      />
    </div>
  );
};

export default AnimatedUnicornBackground;
